import ListGroup from 'react-bootstrap/ListGroup';

export function Listado() {
  return (
    <ListGroup>
        <h1>Participantes de: 'Pokemon World'</h1>
      <ListGroup.Item>Sebastián González</ListGroup.Item>
      <ListGroup.Item>Carlos Maliqueo</ListGroup.Item>
      <ListGroup.Item>Angeles Navarrete</ListGroup.Item>
    </ListGroup>
  )
}
